										dataViews.push({id:"id-c76c9a132509428d813f79d1dd513792", type:"ArchimateDiagramModel", name:decodeURL("AI+Taxonomy+High+Level+View"), documentation:decodeURL("The+AI+Taxonomy+High+Level+View+picture+the+entire+set+of+the+elements+of+the+AI+Taxonomy.%0D%0AThe+AI+Taxonomy+provides+a+structured+categorization+of+all+AI+concepts%2C+techniques%2C+methods%2C+and+domains.+%0D%0AIt+aims+to+classify+the+foundational+aspects+of+AI%2C+including+different+types+of+AI+systems%2C+methodologies%2C+algorithms%2C+and+core+capabilities.%0D%0A%0D%0AThe+AI+Taxonomy+is+a+classification+of+Artificial+Intelligence+%28AI%29+systems.%0D%0AIt+helps+understand+what+an+AI+system+is%2C+what+it+is+doing%2C+how+it+works.+how+can+be+used+and+how+it+relates+to+other+systems.%0D%0A%0D%0AThe+AI+taxonomy+is+useful+for+the+development+and+procurement+of+AI+systems%2C+as+well+as+their+deployment+and+monitoring.%0D%0AIt+helps+understand+what+level+of+AI+governance+should+be+applied%2C+including+data+management%2C+risk+management+and+security+and+ethical+concerns.%0D%0A%0D%0AThe+AI+systems+are+classified+using+different+criteria%3A%0D%0A1.+based+on+the+services+they+provide%0D%0A2.+based+on+how+they+function%2F+how+they+learn+and+reason%0D%0A3.+based+on+where+and+how+they+are+deployed%0D%0A4.+based+on+their+level+of+autonomy+and+risk%0D%0A%0D%0AThe+AI+Taxonomy+is+primarily+developed+to+organize+and+understand+AI+technologies%2C+techniques%2C+and+capabilities+%0D%0Aand+to+guide+development%2C+procurement+and+deployment+of+AI+systems.+%0D%0ANote+that+unlike+biological+taxonomy%2C+the+AI+taxonomy+is+more+dynamic%2C+and+should+be+adapted+more+often+to+capture+the+new+discoveries+in+AI+technology.%0D%0A%0D%0AAI+systems+are+different+from%C2%A0traditional+software+systems+and+classic+programming+approaches.+%0D%0ATraditional+software+systems+are+based+on+rules%2Falgorithms+defined+solely+by+a+human%2C+while%C2%A0AI+systems+can+derive+models+or+algorithms+from+inputs+or+data.%C2%A0%0D%0AWhile+most+AI+systems+are+safe+and+beneficial%2C+it%27s+crucial+to+remember+that+they+can+adapt+after+their+deployment.+%0D%0AThis+self-learning+capability+can+lead+to+a+shift+in+their+objectives%2C+potentially+straying+from+the+intended+purpose.+%0D%0AIt%27s+important+to+be+cautious+and+aware+of+these+risks.%C2%A0%C2%A0+%28Based+on%3A+https%3A%2F%2Fyoshuabengio.org%2F2023%2F06%2F24%2Ffaq-on-catastrophic-ai-risks+%29%0D%0A%0D%0AAI+systems+can+be+stand-alone+or+embedded+in+a+product.%0D%0A%0D%0ADefinition+of+AI+System%3A%0D%0AAI+system+is+a+machine-based+system+that+is+designed+to+operate+with+varying+levels+of+autonomy+and+that+may+exhibit+adaptiveness+after+deployment%2C+and+that%2C+for+explicit+or+implicit+objectives%2C+infers%2C+from+the+input+it+receives%2C+how+to+generate+outputs+such+as+predictions%2C+content%2C+recommendations%2C+or+decisions+that+can+influence+physical+or+virtual+environments%3B+Source%3A+https%3A%2F%2Fartificialintelligenceact.eu%2Farticle%2F3%2F%0D%0A%0D%0A%0D%0A")});
